let datasource = union isfuzzy=true  (datatable(Source: string)[]), (_GetWatchlist('ASimSourceType') | where SearchKey == 'RSASecurIDAMEvent' | project Source);
let forwarder_host_names = dynamic(["hostname1", "hostname2"]);
let EventData = Syslog
| where CollectorHostName in (forwarder_host_names) or Computer in (forwarder_host_names) or CollectorHostName in (datasource) or Computer in (datasource)
| extend EventVendor = 'RSA'
| extend EventProduct = 'RSA SecurID'
| extend EventSchemaVersion = '0.1'
| extend EventCount = 1
| extend EventFields = split(SyslogMessage, ',')
| extend EventType = tostring(EventFields[3])
| extend AgentType = case(EventType has 'runtime', tostring(EventFields[24]), '')
| parse SyslogMessage with * "," * "," * ", " EventType ", " EventSeverity ", " EventOriginalUid "," ImsServerInstance "," SrcIpAddr "," DstIpAddr "," DvcAction "," EventIdCode "," EventResult "," EventResultDetails "," ActorSessionId "," RestOfMessage;
let Admin = EventData
| where EventType has 'admin'
| parse RestOfMessage with BatchId "," UserId "," UserIdentitySrcId "," UserSecurityDomainId "," SrcUserName "," SrcUserFirstName "," SrcUserLastName "," DomainObject1Type "," DomainObject1Id "," DomainObject1IdentitySourceId "," DomainObject1SecurityDomainId "," DomainObject1Name "," DomainObject2Type "," DomainObject2Id "," DomainObject2IdentitySourceId "," DomainObject2SecurityDomainId;
let System = EventData
| where EventType has 'system'
| parse RestOfMessage with UserId "," UserIdentitySrcId "," UserSecurityDomainId "," SrcUserName "," SrcUserFirstName "," SrcUserLastName "," Argument1 "," Argument2 "," Argument3 "," Argument4 "," Argument5 "," Argument6 "," Cause "," EventResultDetails;
let Runtime = EventData
| where EventType has 'runtime'
| parse RestOfMessage with UserId "," UserIdentitySrcId "," UserSecurityDomainId "," SrcUserName "," SrcUserFirstName "," SrcUserLastName "," AgentId "," AgentSecurityDomainId "," DvcIpAddr "," DvcHostname "," AgentType "," PolicyMethodId "," PolicyMethodName "," PolicyId "," PolicyExpression "," Argument1 "," Argument2 "," Argument3 "," Argument4 "," Argument5 "," Argument6 "," Argument7 "," Argument8 "," Argument9 "," Argument10;
let Data = union Admin, Runtime, System;
